import React from "react";
import ReactDOM from "react-dom/client"; // Importuojamas naujas ReactDOM API
import "./index.css";

const App = () => {
  return <h1>Welcome to React 18</h1>;
};

// React 18 naudoja `createRoot` metodą
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
